    </div>
    <script>
        function buttonClick() {
            for (let i = 1; i <= 4; i++) {
                let imgId = `img${i}`
                download(document.getElementById(imgId).getAttribute('src'), function (res) {
                    download2(res, imgId);
                });
            }
        }
        function download(file, callback) {
            let request = new XMLHttpRequest();
            request.responseType = 'blob';
            request.open('GET', file);
            request.addEventListener('load', function () {
                callback(request.response)
            });
            request.send();
        }
        function download2(res, name) {
            var a = document.createElement('a');
            var url = URL.createObjectURL(res);
            a.href = url;
            a.download = name;
            a.click();
        }
        function downloadAllImages() {
            let count = 1
            while (true) {
                let elementImg = document.getElementById(`img${count}`)
                if (!elementImg) { break }
                let elementA = document.createElement('a')
                elementA.setAttribute('href', elementImg.getAttribute('src'))
                elementA.setAttribute('download', elementImg.getAttribute('id'))
                elementA.click()
                count += 1
            }
        }
    </script>
